			BufferedReader br = new BufferedReader(isr);
			String strArr[] = br.readLine().split(" ");

			int n = Integer.parseInt(strArr[0]);
			int a = Integer.parseInt(strArr[1]);
			int b = Integer.parseInt(strArr[2]);
			int answer = 0;

